// TODO find better place for this helper
let hexdump (bytes: byte[]) (start: int) (length: int) =
    let memStream = new MemoryStream(bytes)
    let buffer = Array.zeroCreate 16
    let read = ref 1
    let totalRead = ref start
    let endIndex = start + length
    memStream.Position <- int64 start
    while !read > 0 && !totalRead <= endIndex do
        read := memStream.Read(buffer, 0, buffer.Length)
        printf "%08x  " !totalRead
        let printBlock i =
            for x in i .. i + 3 do 
                if i <= !read then printf "%02x " buffer.[x]
                else printf "   "
            printf " "
        for i in 0 .. 4 .. 15 do 
            printBlock i
        let chars = Encoding.ASCII.GetChars(buffer)
        printf "  |"
        for x in chars do
            let printChar =
                if Char.IsControl(x) then
                    '.'
                else
                    x
            printf "%c" printChar
        printfn "|"
        totalRead := !totalRead + !read

